DROP DATABASE IF EXISTS ECommerce;

-- Create the ECommerce database
CREATE DATABASE ECommerce;
USE ECommerce;

-- drops location table if it is present in the database
DROP TABLE IF EXISTS location;
-- Create the location table to store location information
CREATE TABLE location(
	zip_code_prefix INT PRIMARY KEY,
    latitude DECIMAL (50, 20),
    longitude DECIMAL (50, 20),
    city VARCHAR(30),
    state CHAR(2)
);

-- drops customers table if it is present in the database
DROP TABLE IF EXISTS customers;
-- Create the customers table to store customer information
CREATE TABLE customers (
	customer_id VARCHAR(50) PRIMARY KEY,
    customer_unique_id VARCHAR(50) UNIQUE,
    zip_code_prefix INT,
    -- Foreign key reference to location table
	FOREIGN KEY (zip_code_prefix) REFERENCES location(zip_code_prefix)
);

-- drops orders table if it is present in the database
DROP TABLE IF EXISTS orders;
-- Create the orders table to store order details
CREATE TABLE orders (
    order_id VARCHAR(50) PRIMARY KEY,
    customer_id VARCHAR(50),
    order_status VARCHAR(50),
    order_purchase_timestamp DATETIME,
    order_approved_at DATETIME,
    order_delivered_carrier_date DATETIME,
    order_delivered_customer_date DATETIME,
    order_estimated_delivery_date DATETIME,
	-- Foreign key reference to customers table
    FOREIGN KEY (customer_id) REFERENCES customers(customer_id)
);
-- drops products table if it is present in the database
DROP TABLE IF EXISTS products;
-- Create the products table to store product information
CREATE TABLE products (
    product_id VARCHAR(50) PRIMARY KEY,
    product_category_name VARCHAR(300),
    product_name_lenght INT,
    product_description_lenght INT,
    product_photos_qty INT,
    product_weight_g INT,
    product_length_cm INT,
    product_height_cm INT,
    product_width_cm INT
);
-- drops sellers table if it is present in the database
DROP TABLE IF EXISTS sellers;
-- Create the sellers table to store seller information
CREATE TABLE sellers (
    seller_id VARCHAR(50) PRIMARY KEY,
    zip_code_prefix INT,
    -- Foreign key reference to location table
	FOREIGN KEY (zip_code_prefix) REFERENCES location(zip_code_prefix)
);

-- drops order items table if it is present in the database
DROP TABLE IF EXISTS order_items;
-- Create the order_items table to store individual order items
CREATE TABLE order_items (
    order_item_id INT,
    order_id VARCHAR(50),
    product_id VARCHAR(50),
    seller_id VARCHAR(50),
    price DECIMAL(10, 2),
    freight_value DECIMAL(10, 2),
    -- composite primary key
    PRIMARY KEY (order_item_id, order_id),
    -- Foreign key references to orders, products, and sellers tables
    FOREIGN KEY (order_id) REFERENCES orders(order_id),
	FOREIGN KEY (product_id) REFERENCES products(product_id),
	FOREIGN KEY (seller_id) REFERENCES sellers(seller_id)
);

